webpackJsonp([62],{"./node_modules/json-loader/index.js!./.cache/json/community-articles-and-videos.json":function(e,t){e.exports={data:{allFile:{edges:[{node:{relativePath:"community/articles-and-videos.md",childMarkdownRemark:{frontmatter:{title:"Articles & Videos",order:10}}}},{node:{relativePath:"community/blog.md",childMarkdownRemark:{frontmatter:{title:"Blog",order:0}}}},{node:{relativePath:"community/events.md",childMarkdownRemark:{frontmatter:{title:"Events",order:30}}}},{node:{relativePath:"community/companies.md",childMarkdownRemark:{frontmatter:{title:"Companies",order:60}}}},{node:{relativePath:"community/roadmap.md",childMarkdownRemark:{frontmatter:{title:"Roadmap & Contribution",order:50}}}},{node:{relativePath:"community/examples.md",childMarkdownRemark:{frontmatter:{title:"Examples",order:20}}}},{node:{relativePath:"community/faq.md",childMarkdownRemark:{frontmatter:{title:"Frequently Asked Questions",order:40}}}},{node:{relativePath:"community/index.md",childMarkdownRemark:{frontmatter:{title:"Community",order:0}}}}]},file:{relativePath:"community/articles-and-videos.md",childMarkdownRemark:{html:'<h2 id="ocaml-concepts"><a href="#ocaml-concepts" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>OCaml Concepts</h2>\n<p>Reason is just OCaml under the hood; We don\'t yet cover every concept on this documentation site. These external articles (in OCaml syntax) might help! <strong>Make sure you install <a href="https://github.com/reasonml/reason-tools">reason-tools</a> to translate the syntax to Reason!</strong></p>\n<ul>\n<li><a href="https://realworldocaml.org">Real World OCaml</a>: a comprehensive book on OCaml.</li>\n</ul>\n<h2 id="bucklescript"><a href="#bucklescript" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>BuckleScript</h2>\n<ul>\n<li><a href="http://bucklescript.github.io/bucklescript/Manual.html">BuckleScript Manual</a>: the official documentations for our JavaScript backend.</li>\n<li><a href="http://bucklescript.github.io/bucklescript/api/index.html">BuckleScript JS API docs</a></li>\n<li><a href="http://bucklescript.github.io/bucklescript/docson/#build-schema.json">BuckleScript build system schema</a>: comprehensive resource on <code>bsb</code>\'s configuration.</li>\n<li><a href="https://github.com/glennsl/bucklescript-ffi-cheatsheet">BuckleScript FFI Cheat Sheet</a></li>\n<li><a href="https://github.com/glennsl/bucklescript-cookbook">BuckleScript Cookbook</a></li>\n<li><a href="https://jaredforsyth.com/2017/06/03/javascript-interop-with-reason-and-bucklescript/">JavaScript Interop with Reason and BuckleScript</a></li>\n<li><a href="https://jaketrent.com/post/unit-testing-in-reasonml/">Unit Testing in ReasonML</a></li>\n</ul>\n<h2 id="reasonreact"><a href="#reasonreact" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>ReasonReact</h2>\n<ul>\n<li><a href="//reasonml.github.io/reason-react/">Documentation</a></li>\n<li><a href="https://jaredforsyth.com/2017/07/05/a-reason-react-tutorial/">Interactive ReasonReact Tutorial</a>: features runnable code and type hint on hover!</li>\n<li><a href="https://jamesfriend.com.au/a-first-reason-react-app-for-js-developers">A First Reason React app for Javascript developers</a></li>\n<li><a href="https://jamesfriend.com.au/routing-in-reason-react">Routing in Reason React</a></li>\n</ul>\n<h2 id="videos"><a href="#videos" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Videos</h2>\n<ul>\n<li><a href="https://www.youtube.com/watch?v=vTb8UU_Yjmk">Reason: JavaScript-flavored OCaml</a> July 2017</li>\n<li><a href="https://www.youtube.com/watch?v=dKYAh8vJiSk">A Speed-date with ReasonML</a> May 2017</li>\n<li><a href="https://www.youtube.com/watch?v=tCVXp6gFD8o">Imperfection</a> May 2017</li>\n<li><a href="https://www.youtube.com/watch?v=24S5u_4gx7w">What\'s in a Language?</a> April 2017</li>\n<li><a href="https://www.youtube.com/watch?v=_0T5OSSzxms">Taming the Meta-language</a> March 2017</li>\n<li><a href="https://www.youtube.com/watch?v=8LCmLQ1-YqQ">The Age of Reason(ML)</a> Nov 2016</li>\n</ul>\n<h2 id="pro-links"><a href="#pro-links" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Pro Links</h2>\n<p>The more dated they look, the richer the content =P</p>\n<ul>\n<li><a href="https://gist.github.com/busypeoples/3a28d039272ec3eb33ca2fc6b32dafc7">Phantom Types in Reason</a>: nice example for a hidden feature of Reason/OCaml</li>\n<li><a href="http://okmij.org/ftp/ML/generalization.html?fref=gc">How OCaml type checker works</a></li>\n<li><a href="http://mads-hartmann.com/ocaml/2015/01/05/gadt-ocaml.html">Detecting use-cases for GADTs in OCaml</a></li>\n<li><a href="http://www.polychoron.fr/ocaml-nonmanual/polymorphism.html">Polymorphism and its limitations</a></li>\n<li><a href="http://www.math.nagoya-u.ac.jp/~garrigue/papers/ml2011-show.pdf">Adding GADT to OCaml</a>, <a href="https://groups.google.com/forum/#!topic/ocaml-aggregation-list/-tnouSeSQoY">Locally abstract types vs polymorphic annotations</a>: on GADT and locally abstract types</li>\n<li><a href="https://ocaml.org/learn/tutorials/format.html">Using the Format module</a> and its <a href="https://caml.inria.fr/pub/docs/manual-ocaml/libref/Format.html">docs</a>: great for working with the hidden gem of the OCaml stdlib</li>\n</ul>',frontmatter:{title:"Articles & Videos"}}}},pathContext:{section:"community",sectionTitle:"Community",relativePath:"community/articles-and-videos.md",relatedFiles:"/^community\\/.*\\.md$/"}}}});
